import './App.css';
import Home from './Components/Home'
function App() {
  return (
    <div>
      <navbar className="nav-link">
        <div><h3>V-Meet</h3></div>
        <div>
          <ul className='ul-link'>
            <li>Home</li>
            <li>Meeting</li>
            <li>Add Meeting</li>
          </ul>
        </div>
      </navbar>
    </div>
  );
}

export default App;
